import { FoodService } from '../food.service';

@Component({
  selector: 'app-body',
  templateUrl: './body.component.html',
  styleUrls: ['./body.component.css']
})
export class BodyComponent implements OnInit{

  foods:string[]=[];
constructor(private fs:FoodService){}

ngOnInit(): void {

  this.foods=this.fs.getall();
}

}
